import * as React from "react"
import Head from "next/head"
import { Navbar } from "./Navbar"
import { Footer } from "./Footer"

interface Props {
    children?: React.ReactNode
    ref?: React.LegacyRef<HTMLElement> 
}

const Layout: React.FC<Props> = ({ children,ref }) => {
    return (
        <React.Fragment>
            <Head>
                <title>Hundred and up | creative agency</title>
                <link
                    rel="stylesheet"
                    href="https://necolas.github.io/normalize.css/8.0.1/normalize.css"
                />
                <link
                    href="https://fonts.googleapis.com/css?family=Roboto:100,300,400,500,700&display=swap"
                    rel="stylesheet"
                />
            </Head>
            <Navbar/>
            <main className="body-3" ref={ref}>{children}</main>
            <Footer/>
            <style jsx global>{`
                * {
                    box-sizing: border-box;
                }
                body {
                    background-color: transparent;
                    font-family: "Roboto", sans-serif;
                    color: #2b2c30;
                    font-size: 14px;
                    line-height: 20px;
                    font-weight: 400;
                    margin: 0;
                    padding: 0;
                }
                .body-3 {
                        background-image: url("https://uploads-ssl.webflow.com/5e3fd2b4289861757914c9d9/5e786cd31ede362d67bc8e31_LIGHT%201.png");
                        background-position: 100% 0%;
                        background-size: auto;
                        background-repeat: no-repeat;
                    }

                h1 {
                    margin-top: 0px;
                    margin-bottom: 0px;
                    font-size: 38px;
                    line-height: 44px;
                    font-weight: 700;
                }

                a {
                    text-decoration: none;
                }

                ul {
                    margin-top: 0px;
                    margin-bottom: 0px;
                    padding-left: 0px;
                }
                @media screen and (max-width: 991px) {
                    .body-3 {
                            background-image: none;
                        }
                }
            `}</style>
        </React.Fragment>
    )
}

export default Layout
